import React from 'react';
import Axios from 'axios';


class DeveloperDashboard extends React.Component{
    constructor(props){
        super(props);
        this.state={data:[],error:""}
        Axios.get('http://localhost:3002/user',{withCredentials:true}).then(res=>{
            if(res.status===200){
                Axios.get('http://localhost:3002/name',{headers:{Authorization: `Bearer ${res.data}`}}).then(res=>{
                  this.setState({data:res.data})
                  console.log(this.state.data)
                })
            }
        })
        Axios.get('http://localhost:3002/user',{withCredentials:true}).then(res=>{
            if(res.status===200){
                Axios.get(`http://localhost:3002/cancreate`,{headers:{Authorization: `Bearer ${res.data}`}}).then(res=>{
                    if(res.data==="yes"){
                        this.setState({error:res.data})
                    }
            })
        }
        })
    }

    render(){
        console.log(this.state.data)
        if(this.state.error==="yes"){
        return(
            <div style={{marginTop:"7em",justifyContent:"center"}}><h3 style={{textAlign:"center"}}>You are not a Developer</h3></div>
        )
        }
        else{
                    return(
                        <div style={{marginTop:"7em",justifyContent:"center"}}>
                            <h1 style={{textAlign:"center"}}>Welcome home {this.state.data.user.name}</h1>

                        </div>
                    )
        }
    }
}
export default DeveloperDashboard;
